RNFS.readDir('/games')
    .then((result) => {
     console.log(result.length);
});
class ProjectPage extends React.Component {
    render() {
        return (
            <div className='project'>
            <div className='games'>
            
            </div>
            <Image path = './meow.png' expl = "cats"/>
            </div>
        );
    }
}

export default ProjectPage;
